Drama / Komedie
93 minuten

geregisseerd door Patricia Riggen
met Eva Mendes, Cierra Ramirez en Raini Rodriguez

Grace (Mendes) is een alleenstaande moeder. Ze heeft het te druk met haar werk en de getrouwde Dr. Hartford (Matthew Modine) om aandacht te schenken aan haar dochter Ansiedad (Ramirez). Als Ansiedad's docente Engels coming-of-age verhalen introduceert, blijkt ze gefascineerd en vastbesloten haar adolescentie over te slaan en zich klaar te stomen voor een leven zonder moeder. Met de hulp van een vriend maakt ze zich klaar voor de verkorte weg naar &quot;volwassenheid&quot;. Maar als haar misplaatste plan zich verder ontrafelt moeten Grace en Ansiedad leren dat opgroeien onderdeel is van het accepteren van je leeftijd.



